import React, { useContext } from "react";
import { Container, Input, Item, Left, Right } from "./contextNav";
import { RiYoutubeFill } from "react-icons/ri";
import {IndexMainContext} from "./indexContext";
import Dates from "./contextData";
const ContextNavbar = () => {
  const [state, setState] = useContext(IndexMainContext);
  return (
    <Container>
      <Left>
        <RiYoutubeFill />
        <>YouTube </>
      </Left>
      <Right>
        <Input onChange={(e)=> setState(e.target.value)} type="text" />
        {/* <Item>Home</Item> */}
        <Item>Count :{Dates.length} </Item>
      </Right>
    </Container>
  );
};

export default ContextNavbar;
// 8 birinchi ParentContextni import qivolamz
